import { ReadVarExpr } from '@angular/compiler';
import { Component, OnInit } from '@angular/core';
import { AddItem } from '../shared/user.model';
import { NgForm } from '@angular/forms';
import { UserService } from '../shared/user.service';

@Component({
  selector: 'app-adminupload',
  templateUrl: './adminupload.component.html',
  styleUrls: ['./adminupload.component.css']
})
export class AdminuploadComponent implements OnInit {
  public additem:AddItem;
  constructor(private userService : UserService,
    public readonly router: Router) { }

  ngOnInit(): void {
    this.resetForm();
  }

  public resetForm(form?: NgForm) {
    if (form != null)
      form.reset();
    this.additem = {
      ProductName:'',
      ProductDescription:'',
      Price:'',
      Size:'',
      Image:''
    }
  }
  public async OnSubmit(form: NgForm): Promise<void> {
    this.userService.registerUser(form.value)
    .subscribe(()=>{
      sessionStorage.setItem('loggedUser', this.user.FirstName);
     this.router.navigateByUrl('home');
    this.resetForm(form);
    });
  }
}
